import React from "react";

export const PagoItem = ({ idPago, Fecha_pago, Referencia, Monto_boleta }) => {
    let fecha_n = Fecha_pago;
    let fecha_y = fecha_n.split("T");

    return (
        <tr>
            <td>{idPago}</td>
            <td>{fecha_y[0]}</td>
            <td>{Referencia}</td>
            <td>{Monto_boleta}</td>
        </tr>
    );
};
